import React, { useState } from "react";
import "./App.css";
import Form from "./components/Form";
import TodoList from "./components/TodoList";

const App = () => {

	const [input] = useState("")

	return (
		<div className='container'>
			<header>
				<h1>To-Do List</h1>
			</header>
			<main>
				<Form />
				<TodoList />
			</main>
			<footer>Copyright 2020</footer>
		</div>
	);
};

export default App;
